import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Use Routes instead of Switch
import NavMenu from './component/NavMenu/NavMenu';
import LandingPage from './component/LandingPage/LandingPage'; // Make sure the path is correct
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import CodingPage from './component/CodingPage/CodingPage';
import ComicsPage from './component/ComicsPage/ComicsPage';
import ContactPage from './component/ContactPage/ContactPage';

function App() {
  return (
    <Router>
      <NavMenu />
      <Routes> {/* Use Routes to wrap Route components */}
        <Route path="/coding" element={<CodingPage />} />
        <Route path="/comics" element={<ComicsPage />} />
        <Route path="/contact" element={<ContactPage />} />
        <Route path="/" element={<LandingPage />} />
      </Routes>
    </Router>
  );
}

export default App;
